INSERT INTO `Position` VALUES ('cm5kdzzkw0002s60n29wcpluw','Orthopedic Surgeon','Healthcare',1,'Musculoskeletal medicine and orthopedic surgery. Will see patients in the clinical setting only. ','Ian Barrett','dr.barrett@modernorthopedics.org','800 Pollard Road, Unit C30','','Business casual attire. ','9:00 AM','09:00 AM','11:45 AM','cm5d9jbil0002rtz2v79lu47p','cm5j1a3u5005g68l5b7i5t0wt','2025-09-18 17:55:21.065'),('cm5luk9mb0001s60nygt9l0x6','Equinix Datacenter Tour & Overview of Internet','Multiple Careers',20,'Equinix datacenters are core hubs of the internet where companies like NVIDIA, SpaceX, Google, Instagram, YouTube, TikTok, Starlink, and Riot Games (League of Legends), exchange traffic. \r\n\r\nData centers: They’re something most people don’t think about every day, but they’re the foundation of the technologies we all rely on. Data centers house the infrastructure that makes everything from financial trading to online gaming to digital healthcare possible. While they might operate out-of-sight and out-of-mind for the average person, they’re the backbone of our digital world.\r\n\r\nDiscussion of jobs, not shadowing of jobs, will take place.\r\n\r\nStudents will spend two hours at a datacenter to learn how all of these companies connect and see the physical infrastructure of the Internet with a datacenter tour.  \r\n\r\nTo find out more about Equinix: https://youtu.be/wumluVRmxyA?si=4S9wZhKNRtzr-5VY','Marsie  Sweetland','msweetland@equinix.com','9 Great Oaks, San Jose','You will need to bring your student ID and allow roughly 15 minutes to sign in with security.  Please enter from Great Oaks Blvd (only).  You will pass through the security gate and the security guard will indicate the route to the datacenter.','Any attire is OK but please wear closed toe shoes for safety purposes.  The datacenter floor is cold, so wear relatively warm clothes.','09:45','10:00','12:00','cm5d9jbil0002rtz2v79lu47p','cm5j19wgb002o68l5bm8l0yqi','2025-09-18 17:55:21.065'),('cm5r6help0002s60mbkrjzjnw','Marketing Agency, Graphic Design, Web Development, Account Manager','Marketing/Public Relations',10,'3marketeers is a global marketing services company running programs in 93 countries. As a 39 year  company, the team develops creative, digital, video, print, event, and demand generation programs for B2B technology and healthcare companies.\n\nYou will meet with Art Directors, Graphic Designers, Web Designers, Account Managers, and other Agency team members. \nPlease plan to eat lunch with our team, where you can ask questions and learn different roles, their backgrounds and what routes they chose to get here. \n\nYou will also meet members of our eTrigue team (Marketing software).','Jeff Holmes','jeff.holmes@3marketeers.com','6399 San Ignacio Avenue, Suite 200\nSan Jose, CA\nUpstairs, second floor.','Meet at Suite 200, on the second floor. ','Casual business attire. What you would wear to a job interview.','10:00 AM','10:15 AM','1:30 PM','cm5d9jbil0002rtz2v79lu47p','cm5j1a1lx004k68l5krj9aaxx','2025-09-18 17:55:21.065'),('cm5vux9550000s60mahno5eu1','Attorney','Government/Legal',4,'Step into the shoes of trial attorney Stephanie Rickard! You will learn the ins and outs of what a criminal defense attorney does.','Stephanie Rickard','stephanie@smresq.com','1625 The Alameda, Suite 801\nSan Jose, CA 95126\n\nOur offices are situated one mile from 280 in San Jose, about a 2-mile drive from the Courthouse. Take The Alameda exit from 880 toward downtown San Jose. Proceed through two traffic lights. Look for the First Republic Bank building on the right hand side of the street. There is ample free parking behind the building.','Lunch will be provided.\n\n','Casual business attire. No jeans or sneakers. ','08:45','09:00','16:00','cm5d9jbil0002rtz2v79lu47p','cm5j19zk7003s68l5naccs090','2025-09-18 17:55:21.065'),('cm5wryt2c0000s60n10o9i647','Optometrist','Healthcare',3,'Private Practice Eye Care office.  Students will learn about the healthcare field, specifically primary eye care','Ilene Polhemus','imasonod@gmail.com','15575 Los Gatos Blvd., Los Gatos, CA 95032','Students will meet in the Lobby of the office','Business Casual','09:30','09:30','14:00','cm5d9jbil0002rtz2v79lu47p','cm5j1a0ez004468l5k9lf35m7','2025-09-18 17:55:21.065'),('cm5wtpxkc0001s60n1bokg2vo','Engineering','Engineering/Manufacturing',15,'Experience our labs at Amazon where we build and test our devices. Learn about audio and wireless capabilities and also get to see a demonstration with our robot Astro!','Maya Osborne','mayaosbo@amazon.com','1100 Enterprise Way, Sunnyvale CA 94089','Please bring a photo ID and allow an extra 15 minutes for parking and check-in.  No food or drinks are allowed in the labs. We will provide lunch.','Please wear closed-toed shoes','09:45','10:00','15:00','cm5d9jbil0002rtz2v79lu47p','cm5j19u97001w68l5821a0ls7','2025-09-18 17:55:21.065'),('cm5y1veiw0000s60nbsg8mq4k','Oral and Maxillofacial Surgery','Healthcare',2,'Shadow and oral surgeon','Troy Follmar','tfollmar@follmaroms.com','14511 S. Bascom Ave, Los Gatos CA 95032','Please arrive in our waiting room at 7:30am, please make sure to eat breakfast prior to arriving.  We will cater lunch at the end of the morning.','Professional attire or scrubs','07:30','07:30','12:00','cm5d9jbil0002rtz2v79lu47p','cm5j19zap003o68l5zfzq915f','2025-09-18 17:55:21.065'),('cm5y2oz0c0001s60nrk3mq8ve','Real Estate Agent','Real Estate/Construction',2,'Behind the scenes look at residential real estate sales. \nProcess discussion; from marketing, photo/videography, 3D/2D data capture, introduction to clients, needs assessment, contracts, disclosures, negotiations, legal, finance, tax, etc.. Lots more going on than \"Million Dollar Listing\" fancy homes & fabulous \"influencers\". \nWe will also \'field trip\' to visit 2 or 3 active houses for sale in Los Gatos.','Ed Dee','ed@liveyoursanctuary.com','Office Address: 16185 Los Gatos Blvd #205, Los Gatos, CA 95032, USA','Meet at Los Gatos Coffee Roasting Company on Main.\n\nCome prepared with a minimum of 3 questions pertaining to residential real estate sales.','School/Business appropriate attire. (No flip flops or shorts, etc..)','09:00','09:10','12:00','cm5d9jbil0002rtz2v79lu47p','cm5j19yeg003c68l5ibnlkciv','2025-09-18 17:55:21.065'),('cm5ynmo6t0000s60mptxfufw6','Software Engineer','Engineering/Manufacturing',2,'Study.com is an online education platform that helps learners of all ages excel academically and close skills gaps. From test prep and homework help to earning low-cost college credit and developing workplace skills, Study.com\'s online courses, short animated video lessons and study tools have made learning simple for over 30 million students, teachers and working professionals.\n \nSee what a software engineer\'s day is like at an Ed-Tech company. Get resume writing tips. Go through a practice interview. Maybe even write some code.','Jonathan Grant-Richards','jgrantrichards@study.com','100 View Street #202, Mountain View, CA 94041','Please print and have a parent sign this liability waiver. Email it to your host and/or bring it with you on job shadow day: https://drive.google.com/file/d/1P2V0lBlBs91XVHro90wVM5T4goGHQQGS/view?usp=sharing.             I can provide rides if needed.  Otherwise, just come up to the office and someone will come find me.  I will send some forms to sign beforehand.  Bring a hard copy of your resume if you have one.  Lunch will be provided.','','09:00','09:00','13:00','cm5d9jbil0002rtz2v79lu47p','cm5j19tuv001s68l5awmt72yq','2025-09-18 17:55:21.065'),('cm609mptk0000s60mmjzdw4w3','Various careers at Lockheed Martin','Multiple Careers',30,'This opportunity is for any student interested in the Aerospace and Defense industry.  Careers include: Engineering, Assembly, Finance, Program Management, Human Resources, etc.\r\n\r\nImportant notes:  \r\n1) You must be a US citizen to attend this session.\r\n2) Email your date of birth to admin@jobcamp.org ASAP.\r\n3) A parent/guardian will need to complete this release by Monday March 3rd. https://mrf.external.lmco.com/\r\nChoose \"2025 LM Space Los Gatos High School...\" event from the dropdown.\r\n4) Bring student ID with you on Monday, March 10th.\r\n\r\nAgenda:\r\n10-10:30 Welcome\r\n10:30-11:30 Satellite H-Bay Tour\r\n11:30-1:15 Lunch & Speed Mentoring session\r\n1:30-2:30 Solar Array Tour\r\n2:30-2:45 Wrap up','Mike Corriea','michael.r.corriea@lmco.com','Main Gate at 1111 Lockheed Martin Way, Sunnyvale, CA. \r\n\r\nParticipants will meet at the Visitors Center B/110','Please arrive at 9:15 to allow time to get through the security checkpoint.\r\n\r\nNOTE: Map apps may take you to the back gate on Enterprise Way. You need to go to the front gate instead, from Mathilda Avenue.\r\nDirections to the LM Sunnyvale Facility: \r\n1. Take US 101 North. Take the Mathilda Avenue Exit.\r\n2. Exit Mathilda Avenue North\r\n3. Merge onto North Mathilda Ave. \r\n4. Continue North for several signal lights to Lockheed Martin Way (Java Drive)\r\n5. Turn Left onto Lockheed Martin Way. You will see signs pointing to the Lockheed Martin Visitor Center (on the left, before the entrance gate guard post).\r\n6. Turn left into the Visitor Center parking lot and go inside. Identify yourself as a visitor and present your drivers license or student ID. They will already have your name on a list. You will be required to sign-in and be given a Visitor’s Badge.  \r\n7. A Lockheed Martin employee will meet you here to escort you.','Business casual with close-toed shoes.\r\n\r\nNote: electronic devices and phones must be left in the home base conference room during tours.','09:15','10:00','14:45','cm5d9jbil0002rtz2v79lu47p','cm5j19zuj003w68l59lh2rc2c','2025-09-18 17:55:21.065'),('cm61033dm0002s60nkyky1k39','Investment ','Finance/Accounting',4,'Scharf Investments is a Los Gatos-based firm specializing in both investment and wealth management, helping clients build, grow, and protect their financial futures. With over $4 billion in assets under management, the firm combines research-driven investing with personalized financial planning for individuals, families, and institutions. The team includes portfolio managers, wealth advisors, analysts, and other professionals who work together to select investments, guide clients through major financial decisions, and develop long-term wealth strategies. Shadowing Scharf Investments offers an inside look at how experts collaborate to analyze markets, build investment portfolios, and create tailored financial plans. It’s an opportunity to experience the fast-paced world of finance and see strategic decision-making in action.','Kim Luong','kim.luong@scharfinvestments.com','16450 Los Gatos Blvd., Suite 207 \r\nLos Gatos, CA 95032','Ste 207 second floor. \r\nWhen students come in, they will be greeted and direct to appropriate area.  No sign in.  ','Business casual','08:00','08:05','10:00','cm5d9jbil0002rtz2v79lu47p','cm5zuem310001s60mvq5kpfos','2025-09-18 17:55:21.065'),('cm616000n0001s60mi7kcn3nc','Pediatrician','Healthcare',1,'Well child checks and sick visits','Jane Chen','drc.losgatospediatrics@gmail.com','320 Dardanelli Lane\r\nSuite 16\r\nLos Gatos, CA 95032','Computer is on wheels.  Prepare to stand all day.','Professional and fun','09:30','09:30','17:30','cm5d9jbil0002rtz2v79lu47p','cm5j1a44d005k68l5nb7klz35','2025-09-18 17:55:21.065'),('cm62vrpgt0000s60mvp8xbsh7','PE Teacher','Education',1,'Loma Prieta Elementary School, the home of the Cougars has been serving our mountain community for more than 60 years. We are proud of our students\' academic accomplishments, as well as our commitment to educate the whole child.  Loma Prieta Elementary offers a comprehensive curriculum for grades K-5 including a specialized PE program, music, art, and science.  Our students pride themselves on being part of a caring and welcoming community. \r\n\r\nThis year you will be shadowing the PE teacher at Loma Prieta Elementary. ','Amy Ramsay','a.ramsay@lpjusd.us','23800 Summit Road','Meet in the front office ','Casual attire; closed-toed shoes','08:00','08:15','12:00','cm5d9jbil0002rtz2v79lu47p','cm5j1a6cl006g68l5zb8mxkft','2025-09-18 17:55:21.065'),('cm62vtbmz0001s60mhjvn6bfa','Kindergarten Teacher','Education',1,'Loma Prieta Elementary School, the home of the Cougars has been serving our mountain community for more than 60 years. We are proud of our students\' academic accomplishments, as well as our commitment to educate the whole child.  Loma Prieta Elementary offers a comprehensive curriculum for grades K-5 including a specialized PE program, music, art, and science.  Our students pride themselves on being part of a caring and welcoming community. \r\n\r\nThis year you will be shadowing one of our Kindergarten teachers at Loma Prieta Elementary. ','Amy Ramsay','a.ramsay@lpjusd.us','23800 Summit Road','Meet at the front office','casual professional attire; closed-toed shoes','08:00','08:15','12:00','cm5d9jbil0002rtz2v79lu47p','cm5j1a6cl006g68l5zb8mxkft','2025-09-18 17:55:21.065'),('cm62w7tmp0006s60m1cg4lrl4','Lori Hunt - 2nd Grade Teacher','Education',2,'You will be with me all day in the classroom both observing and participating in certain areas.','Lori Hunt','hunt_lori@cusdk8.org','12300 De Sanka Avenue\r\nSaratoga, CA 95070',' Meet me in the school\'s front entrance at 8:00am.\r\nBring your own lunch.  ','Jeans are OK, just no holes. ','08:00','08:00','14:30','cm5d9jbil0002rtz2v79lu47p','cm62w3pvs0003s60mskhtk909','2025-09-18 17:55:21.065'),('cm62wcfep0007s60mszpwjlji','Melissa Hickman - 1st/2nd Combo Teacher','Education',2,'You will be helping me and observing in the classroom, learning what it\'s like to be an elementary school teacher. It\'s going to be fun!','Melissa Hickman','hickman_melissa@cusdk8.org','12300 De Sanka Avenue\r\nSaratoga, CA 95070','Bring your own lunch. \r\n\r\nIf you want to leave early at lunch that\'s ok too ( at 12:10). \r\n\r\nCome to the office in the morning and I can meet you there.','Make sure you wear comfortable clothes because we move around a lot and will have PE that day too. ','08:00','08:00','14:30','cm5d9jbil0002rtz2v79lu47p','cm62w3pvs0003s60mskhtk909','2025-09-18 17:55:21.065'),('cm62wfqwx0008s60mwunfv485','Rachel Cherry - 2nd Grade Teacher','Education',2,'You will be observing and helping me in the classroom. You will learn what it\'s like to be an elementary school teacher.  It\'ll be fun!','Rachel Cherry','cherry_rachel@cusdk8.org','12300 De Sanka Avenue\r\nSaratoga, CA 95070','Bring your own lunch.\r\n\r\nCome to the school\'s front office and I will meet you there.','Wear close toed shoes and dress in layers. ','08:00','08:00','14:30','cm5d9jbil0002rtz2v79lu47p','cm62w3pvs0003s60mskhtk909','2025-09-18 17:55:21.065'),('cm62xeaf7000ds60mldqigqsj','Megan Mahoney - 5th Grade Teacher','Education',2,'Be ready to work with small groups of students in my 5th grade classroom!','Megan Mahoney','mmahoney@lgusd.org','17770 Daves Avenue\r\nMonte Sereno, CA 95030','Come to the school\'s front office and I will meet you there.','Please wear school appropriate clothing.','08:00','08:00','10:00','cm5d9jbil0002rtz2v79lu47p','cm62xb5a7000as60mrvxurrx3','2025-09-18 17:55:21.065'),('cm62xgkr8000es60mjy42j2re','Jolynn Dariano - Kindergarten Teacher','Education',2,'You will be assisting at a rotation, prepping projects, and helping out at recess. ','Jolynn Dariano','jdariano@lgusd.org','17770 Daves Avenue\r\nMonte Sereno, CA 95030','Feel free to bring a snack. ','Please wear school appropriate clothing.','08:00','08:15','10:30','cm5d9jbil0002rtz2v79lu47p','cm62xb5a7000as60mrvxurrx3','2025-09-18 17:55:21.065'),('cm62ygbbn000fs60m3sakomh9','Healthcare Professionals Medical Panel','Healthcare',15,'Joining the medical panel will give you an opportunity to hear from multiple healthcare professionals during the session.\r\n\r\nAs of Jan 18th, the medical panel consists of:\r\n\r\n* Ben Cortez: Pediatric Intensivist at Kaiser (Panel Moderator)\r\n* Karolina Thompson:  OBGYN at Kaiser\r\n* Carolyn Ford-Hemann:  Healthcare administrator overseeing 2 surgery centers, ambulatory care, and Kaiser professional for 20 years\r\n* Balaji Venkat:  Emergency room physician\r\n* Janet Hong-Auyoung:  PA at Kaiser / Clinical manager\r\n','Ben Cortez','benedicto.cortez@gmail.com','Los Gatos High School\r\nRoom 5 (main building)','Come ready with questions!','','08:50','09:00','10:30','cm5d9jbil0002rtz2v79lu47p','cm5j19z03003k68l521pgr9pq','2025-09-18 17:55:21.065'),('cm641fans0004s60m6ac1v088','Mental Health Professionals Panel','Healthcare',6,'Join us to learn about becoming a mental health professional. There will be at least two professional psychologists/psychotherapists to talk about different paths to this field and what our work looks like.','Holly Osment, LMFT, LPCC, CST','hollyosment@gmail.com','15814 Winchester Blvd, Suite 101\r\nLos Gatos, CA 95030','Building is very close to the intersection of Winchester & Daves Ave, and next door to Pottery Planet.\r\nSuite 101 is in the front of the building. Park and look for signs guiding you to the correct spot.','Casual; anything is fine','08:50','09:00','10:30','cm5d9jbil0002rtz2v79lu47p','cm6411y3x0001s60m4mabwxgo','2025-09-18 17:55:21.065'),('cm65dv4uo0004s60m7ea24ecp','Startup Founder, Entrepreneur, and Venture Capitalist (investor)','Entrepreneurship',15,'Join for aninteractive session where I’ll share my personal story of founding a tech venture, transitioning into venture capital, and investing in bold new markets—ranging from pet tech to AI, alternative energy, and beyond. Along the way, you’ll hear real startup successes (and failures) gathered from my experiences building and investing in companies on five continents.\r\n\r\nCome ready to brainstorm and ask questions. We’ll open the floor to your ideas, dive into the ups and downs of the startup world, and explore how you can turn your own vision into reality. I’ll also offer access to my network and help connect you with potential mentors in the tech and business community. Whether you’re dreaming of building the next big thing or just curious about the world of entrepreneurship, this session will give you an inside look—and maybe spark your own journey, too.','Collin Hartigan','collinhartigan@gmail.com','Los Gatos High School College & Career Center (main building)','Bring all of your questions and your best startup ideas','','10:00','10:05','11:00','cm5d9jbil0002rtz2v79lu47p','cm65cymva0001s60m3ebg5kvw','2025-09-18 17:55:21.065'),('cm65eqgt70009s60mpzes7rwr','Electric Bike Shop Founder & Owner','Small Business Owner',9,'Andrew Davidge, founder of Vintage Electric, is an LGHS graduate. He is opening his shop for a tour and to share his business model and how LGHS helped him create this business. ','Andrew Davidge','andrew@vintageelectricbikes.com','1725 De La Cruz Blvd\r\nSuite 4 \r\nSanta Clara, CA 95050','','Wear close-toed shoes. \r\nCasual attire is fine.','12:55','13:00','15:00','cm5d9jbil0002rtz2v79lu47p','cm65egxxj0006s60mjyv4b66t','2025-09-18 17:55:21.065'),('cm65f6fb8000as60mf08madyt','Michelle Peattie - Kindergarten Teacher','Education',2,'Shadowing students will join small group rotations in ELA, Math, Social Studies, or Art and helping prepare student centered activities. They may also help supervise and problem solve during recess. ','Michelle Peattie','mpeattie@lgusd.org','17770 Daves Ave\r\nLos Gatos, CA 95030','Bring a snack, if you wish.','Please dress in school appropriate attire.','08:00','08:00','11:30','cm5d9jbil0002rtz2v79lu47p','cm62xb5a7000as60mrvxurrx3','2025-09-18 17:55:21.065'),('cm65j81b00004s60msh8c9i8f','Consulting Arborist','Small Business Owner',2,'Student can learn about the day to day operations of working as a consulting arborist in a tree company.  Review arborist reports and landscape designs, listen in on client calls, visit a job site to review a potential project or view work completed by a tree crew.','Ned Patchett','audrey@nedpatchettconsulting.com','971 Terminal Way\r\nSan Carlos, CA','Meet in office.  Preferably ride along to client meetings.','Closed toed shoes, jeans are fine.','11:30','11:30','15:30','cm5d9jbil0002rtz2v79lu47p','cm65itc7q0001s60mcn3sxeer','2025-09-18 17:55:21.065'),('cm65olfgk0004s60nbv1crh79','Veterinarian','Veterinarian',4,'You will get to see a surgery, observe appointments, and see treatment\'s and diagnostics being performed on patients.  ','Heather Bryant','heather@elgatovet.com','15748 Los Gatos Blvd\r\nLos Gatos, CA 95032','Please park on the street or at the nob hill next store. Please check in with the receptionist.','Please wear closed-toed shoes.','08:45','09:00','13:00','cm5d9jbil0002rtz2v79lu47p','cm65o4exp0001s60n1kauasbd','2025-09-18 17:55:21.065'),('cm67wfq0q0000s60m2u5w8ys5','Restaurant/Small Business Owner','Small Business Owner',3,'During the job shadow day students will learn what running a restaurant is like behind the scenes. They will learn about the financial/bookeeping aspect, kitchen operations, customer service, and management skills. ','Sara Williams','sarassouthernkitchen@gmail.com','27 E. Min Street, Los Gatos CA 95030','Meet at the restaurant at 9am with any note taking materials you might want. ','Close toed shoes','09:00','09:00','11:00','cm5d9jbil0002rtz2v79lu47p','cm5j1a2q5005068l5szszw7tf','2025-09-18 17:55:21.065'),('cm68jjoqh0004s60mo8xpmex5','Medical Assistant','Healthcare',1,'Interested in what an Medical Assistant does? Shadow our MA rooming patients, preparing and consenting for procedures, room set-up and turn-over, and much more.','Brianna Morris','losgatospodiatrygroup@gmail.com','14651 S. Bascom Ave\r\nSuite 215\r\nLos Gatos 95032','','Please dress in casual business attire (the office wears scrubs but we would not require students to buy scrubs for the Job Shadow Day), Lunch will be provided from 1-2pm.','08:15','08:30','16:30','cm5d9jbil0002rtz2v79lu47p','cm68ilmhz0001s60maeonmpes','2025-09-18 17:55:21.065'),('cm68jlnut0005s60mw1ap13bt','Front Office Administrator','Healthcare',1,'Interested in Front Office? Shadow our Front Office staff scheduling appointments, patient Check-in and Check-out, Patient intake, Practice Management data entry, and much more.','Brianna Morris','losgatospodiatrygroup@gmail.com','14651 S. Bascom Ave\r\nSuite 215\r\nLos Gatos 95032','','Please dress in casual business attire (the office wears scrubs but we would not require students to buy scrubs for the Job Shadow Day), Lunch will be provided from 1-2pm.','08:15','08:30','16:30','cm5d9jbil0002rtz2v79lu47p','cm68ilmhz0001s60maeonmpes','2025-09-18 17:55:21.065'),('cm68jnndk0006s60md59eoo64','Podiatrist','Healthcare',1,'Interested in what a Provider does? Shadow our providers as they evaluate and treat patients for various foot/ankle issues.','Brianna Morris','losgatospodiatrygroup@gmail.com','14651 S. Bascom Ave\r\nSuite 215\r\nLos Gatos 95032','','Please dress in casual business attire (the office wears scrubs but we would not require students to buy scrubs for the Job Shadow Day), Lunch will be provided from 1-2pm.','08:15','08:30','16:30','cm5d9jbil0002rtz2v79lu47p','cm68ilmhz0001s60maeonmpes','2025-09-18 17:55:21.065'),('cm68zb5e70001s60nefxtfavn','Data Analytics','Engineering/Manufacturing',3,'Spring Education Group is a multi-brand network providing private school education from infant care through high school. The company has 204 schools across the U.S. & internationally, and a globally accessible online private school education from infant care through high school.\r\n\r\nThe student will have overview of Spring Education organization. And then he/she will have an opportunity of learning of the role of analytics department. There will be presentations and samples of data projects including tools (Tableau and Salesforce) are used in the department. The shadow will be in Pruneyard, Campbell. The VP of Analytics will host the students.','Fatosh Hacigumus','fatosh@gmail.com','\r\n1999 S Bascom Avenue, Suite 400 • Campbell, CA',' The student can be dropped off at 1999 S. Bascom Avenue, Campbell. The host will be waiting in the lobby at 8:45 AM. The shadowing session will run until 11:30 AM, followed by lunch.','Business casual','08:45','09:00','12:00','cm5d9jbil0002rtz2v79lu47p','cm5j19ypp003g68l53gog4bac','2025-09-18 17:55:21.065'),('cm6em8std0004s60mfn2y0jz4','Software Developer','Engineering/Manufacturing',30,'Learn about Software Development at a large tech company.  \r\nFormat: A brief presentation followed by a coding demo and Q&A.\r\nPresenter has 20+ years developing software for Automotive, Aerospace and 5+ years at Meta.','Cameron Tulee','cktulee@gmail.com','LGHS College & Career Center (main building)','LGHS College & Career Center (main building)','No special requirements','14:15','14:30','16:30','cm5d9jbil0002rtz2v79lu47p','cm6ely7av0001s60m973x5635','2025-09-18 17:55:21.065'),('cm6f6pee80001s60m317nrbei','Introduction to robotic aided surgery','Multiple Careers',25,'Attendees will receive a presentation to provide Company overview, complete manufacturing line tour, daVinci system demonstration and also interact for career conversation with Intuitive team members.','Ryan Bertsch','ryan.bertsch@intusurg.com','Intuitive Surgical, Building 115, 3420 Central Expressway, Santa Clara, CA 95051','Arrival Time: 10:00:00 AM\r\nEnd Time: 1:30:00 PM\r\n\r\nInstructions:\r\n10:00 – 10:10AM: Welcome \r\n10:10 – 10:45AM: Company overview, products and operations \r\n10:45 – 11:30AM: Manufacturing tour \r\n11:30 – 12:30PM: da Vinci system demonstration \r\n12:30 – 1:30PM: Interactive discussion and working lunch with cross discipline professionals (Finance, Operations, and Engineering) \r\n1:30PM: Closing\r\n','Business casual; closed toe shoes for manufacturing area tour and system demo','09:45','10:00','13:30','cm5d9jbil0002rtz2v79lu47p','cm5j19q1n000c68l5rcqgdxff','2025-09-18 17:55:21.065'),('cm6ft4im10001s60n7mshwecj','General/Family Dentist','Healthcare',2,'digital imaging (3D scanning) and milling crowns, observing dentists, hygienists, dental assistants on a typical day in the life at a dental office, behind the scenes. ','Christina Fantino','oakmeadowdental@gmail.com','Oak Meadow Dental Center\r\n210 Oak Meadow Dr\r\nLos Gatos, CA 95032','Bring your questions, enthusiasm and arrive on-time. We will be meeting 15 minutes prior to our morning huddle and you will be able to see what our day is like from the dentists perspective. ','Please wear scrubs if possible as well as closed toed (tennis type shoes)','08:30','08:30','12:00','cm5d9jbil0002rtz2v79lu47p','cm5j19vvl002g68l5bb5s9801','2025-09-18 17:55:21.065'),('cm6i6hvr90005s60mgli44lz8','Commercial Real Estate Broker ','Real Estate/Construction',1,'As a commercial real estate broker, I act as an intermediary between property owners and businesses looking to lease commercial spaces. My role involves analyzing market trends, valuing properties, and negotiating deals to ensure the best outcomes for your clients. You\'ll spend time networking, conducting property tours, and developing in-depth knowledge of local real estate markets. Strong communication and problem-solving skills are essential, as you\'ll often be working to align the interests of multiple parties in complex transactions.','Alyssa Chaulklin','alyssa.chaulklin@jll.com','356 Santana Row, Suite 1000 San Jose CA, 95128','Our office is located at Santana Row. There is a parking garage where we can provide validated parking. Our suite is located between Arc\'Teryx and Madewell on the second floor. ','Our office follows business casual attire. Jeans are okay, but they should not have any rips, show midriff or sagging. Shirts should not have any large graphics, logos or too revealing. Standard attire for the men in our office include polo shirts, dark jeans and a comfortable shoe. Standard attire for the women in our office include modest blouse, dark jeans and comfortable shoes. ','09:00','09:30','14:30','cm5d9jbil0002rtz2v79lu47p','cm6i5wnzk0001s60mt9i7fqvk','2025-09-18 17:55:21.065'),('cm6ibxrsb0000s60mxnfzwjjm','Pediatric Dentist at Los Gatos Pediatric Dentistry','Healthcare',2,'We are Los Gatos Pediatric Dentistry and Dr Rabitz Pediatric Dentistry. We are a local pediatric dental practice providing comprehensive, compassionate care for children in the community. Our experienced team of professionals are committed to helping children build and maintain a healthy smile for life. \r\n\r\nBy using a playful approach and gentle chairside manner, our team can get even the most hesitant children to relax and accept dental care. Our goal is to protect children\'s teeth and gums and inspire good dental care habits for lifelong oral health. ','Chanel McCreedy','chanel@lgkidsdentistry.com','15827 Los Gatos Blvd, Suite B\r\nLos Gatos, CA 95032','Please come through the front door of the office to be greeted by our front office team. You\'ll meet with our pediatric dentist and observe a day of pediatric dentistry.','Please arrive in professional, business casual attire with closed toed shoes. ','12:00','12:00','15:30','cm5d9jbil0002rtz2v79lu47p','cm5j19tjt001o68l5aqlyr1b5','2025-09-18 17:55:21.065'),('cm6itz0pl0000s60n1z5f46je','Adtech Sales Professional','Sales',25,'Calling all students who are interested in studying Communications, Marketing, Business, Creative and/or Data Analytics. You will learn all the fun (and grit!) that is part of Adtech at Pinterest. This includes components of consultative sales, creative strategy and measurement in order to help advertising partners plan, execute and succeed with digital advertising campaigns. \r\n\r\nWe will discuss what it means to have strategic vision, partnership building skills, product expertise and most importantly, great collaboration skills when working in the industry and at Pinterest! ','Sally Zeman','szeman@pinterest.com','395 Page Mill Rd, Palo Alto, CA\r\n2nd floor ','Free parking is available behind the building and main entrance is from the parking lot. This meeting requires pre-registration by the student in sharing their name and email address when signing up and then host will send them a short non-disclosure agreement from Pinterest, Inc, to sign in advance. Please bring ID for checking-in and your own water bottle.','','13:45','14:00','15:30','cm5d9jbil0002rtz2v79lu47p','cm5jxflyk0001s60ms1aoxxxw','2025-09-18 17:55:21.065'),('cm6jk3vz20000s60mru6dwe25','Dentist','Healthcare',1,'Step into the shoes of Dr. Nicole Pagonis and see the ins and outs of what it\'s like to be a dentist. Dr. P and her terrific team are ready to welcome 1 lucky student!','Nicole Pagonis','contact@doctorpdentistry.com','14830 Los Gatos Blvd\r\nSuite 104\r\nLos Gatos, CA 95032','Please print and complete this form. Bring it with you to job shadow day.\r\nhttps://drive.google.com/file/d/1qs5le4ufWoWAao9DtgHQco1H1BqwxfW7/view?usp=sharing','Business casual attire appropriate for a doctor\'s office employee.','09:00','09:00','11:00','cm5d9jbil0002rtz2v79lu47p','cm5j1a25b004s68l5c31q1uj0','2025-09-18 17:55:21.065'),('cm6l1jk3u0000s60ngl9imn8y','Family Physician','Healthcare',1,'Students will shadow me as I take care of patients in my office with the patient\'s approval.','Tiffany Davies, MD','tdavies@losgatosdoctors.com','360 Dardanelli Ln\r\nLos Gatos, CA 95032','You will have a 2 hour break at lunch where you may either leave to get food or can stay here and eat something brought from home.  \r\n\r\nIf you wish to shorten the day, you can leave before 5pm.','Dress in business casual attire.','08:30','08:30','17:00','cm5d9jbil0002rtz2v79lu47p','cm6k7ugw80001s60ni5fxs43v','2025-09-18 17:55:21.065'),('cm6qr29pc0000s60nnxn25p6o','Product Marketing','Marketing/Public Relations',10,'How to get into Product Marketing\r\nWhat is relevant to Cybersecurity customers.\r\nHow to get into Cybersecurity\r\nWhat does Product Marketing do?','Andrew Horwitz','ahorwitz@netskope.com','2445 Augustine Dr 3rd floor\r\nSanta Clara, CA 95054','Park in parking deck and get ticket.  We have a machine to validate.\r\nTake elevator to the third floor','Business Casual','09:45','10:00','12:00','cm5d9jbil0002rtz2v79lu47p','cm6qpa1ud0001s60m99711034','2025-09-18 17:55:21.065'),('cm6qxnzwn0004s60nlswxqxfi','Probation Officer','Police/Fire/Security',10,'Students will learn about the role of Probation in the community, the requirements for becoming a Probation Officer and the probation career pathway. ','Victoria Contreras-Wolfe','victoria.contreras-wolfe@pro.sccgov.org','840 Guadalupe Parkway\r\nSan Jose, CA  95110','Please meet outside the building at the Juvenile Center sign located in front of 840 Guadalupe Parkway.  ','Business casual.  Clothing should be free from offensive images, words or logos. ','09:00','09:30','16:00','cm5d9jbil0002rtz2v79lu47p','cm6qx4vok0001s60nvpmw8qps','2025-09-18 17:55:21.065'),('cm6ri2xa20000s60m6az3yzpa','Marketing, Product Mgmt, Engineering','Multiple Careers',2,'Students will get a tour of the NVIDIA headquarters in Santa Clara. They will get introduced to people in various teams from marketing, to product management, to engineering working on AI (artificial intelligence) products. I will give them advice on my career journey and what they should think about as they go through high school, apply to colleges, think about internships, and ultimately a major and career. Students will experience a day in the life of one of the leading AI and graphics companies in the world. Lunch will be provided.','Charlie Huang','charlieandjenny@gmail.com','NVIDIA HQ (Endeavor Building)\r\n2788 San Tomas Expressway\r\nSanta Clara, CA 95051\r\n','Meet at the lobby of the NVIDIA Endeavor building at 9:30am. Bring ID to sign in for a visitor badge.\r\nLunch will be provided.\r\nI will provide some souvenier, but students can bring extra money if they are interested in buying any additional NVIDIA logo\'d items.','Business casual. Khakis/chinos and a collared shirt preferred. Jeans okay, but no holes. Close toed shoes preferred. No slippers, no beachwear.\r\n','09:30','09:30','13:30','cm5d9jbil0002rtz2v79lu47p','cm5j1a3k2005c68l56qicnjeu','2025-09-18 17:55:21.065'),('cm6s1xg9c0000s60mc2ja0msi','Engineering','Engineering/Manufacturing',15,'Archer is a leader in electric vertical takeoff and landing (eVTOL) aircraft.  Afternoon will include an overview of Archer and air taxi industry, tour of battery manufacturing, aircraft build and simulator facilities. Everyone will get a chance to fly the aircraft simulator.','Tosha Perkins','tosha.perkins@archer.com','190 W. Tasman, San Jose, CA 95134','Students will sign an NDA once they are assigned to this position. ','Closed-toed shoes','14:30','15:00','17:00','cm5d9jbil0002rtz2v79lu47p','cm69xi1lw0001s60mr69jrg5o','2025-09-18 17:55:21.065'),('cm6scw7l60000s60mq7tc16fg','Jennie Fink - Kindergarten Teacher','Education',1,'helping me teach, working with children :)','jennie fink','jfink@lgusd.org','16445 Los Gatos Blvd.','Our day starts at 8:10 in room 4. Please check in at the front office.','comfortable :)','08:00','08:10','13:30','cm5d9jbil0002rtz2v79lu47p','cm5j19x1s002w68l5j8gppk9i','2025-09-18 17:55:21.065'),('cm6tpgl7o000hs60mx4bj3tgh','Lisa Antunes - 6th Grade English Teacher','Education',2,'Students will be helping me in the classroom with a 6th grade English class.','Lisa Antunes','lantunes@lgusd.org','19195 Fisher Ave\r\nLos Gatos, CA 95032','Check in at the main office.\r\nRoom R6.','','10:30','10:15','12:00','cm5d9jbil0002rtz2v79lu47p','cm5j19qcf000g68l5loxvvoam','2025-09-18 17:55:21.065'),('cm6txgopg0004s60ncs6u65oq','Non-Profit Manager / Executive Director','Non-Profit',4,'The exact agenda is TBD, but it will be a mix of time spent outdoors in the community or at a school site, in meetings and in the office reviewing contracts and budgeting. ','Wendy Riggs','lgsr2s@gmail.com','17010 Roberts Rd, Los Gatos CA 95032','We will begin the day at a school site in Los Gatos or Monte Sereno, exact meeting spot TBD','Dress business casual (jeans are OK) wear comfortable walking shoes. We will be outdoors a times, so dress for the weather.','07:45','07:45','15:00','cm5d9jbil0002rtz2v79lu47p','cm6tx43n90001s60ngf5ck77x','2025-09-18 17:55:21.065'),('cm6ubhfm00001s60mrkx0h08a','Corey Miller - Musical Theater & Choir Teacher','Education',3,'I\'ll be working with my Musical Theatre Class, Treble Choir, and Encore advanced choir.','Corey Miller','cmiller@lgusd.org','19195 Fisher Ave\r\nLos Gatos, CA 95032','Bring own lunch. \r\nCheck in at the front office.','','08:15','08:30','13:15','cm5d9jbil0002rtz2v79lu47p','cm5j19qcf000g68l5loxvvoam','2025-09-18 17:55:21.065'),('cm6ubl3rb0002s60mczgwq7jh','Melissa Weiss - Teacher','Education',2,'You\'ll be helping me run the PE classes -- football or rugby!','Melissa Weiss','mweiss@lgusd.org','19195 Fisher Ave\r\nLos Gatos, CA 95032','Check in at the front office.','Comfortable clothes with good tennis shoes for outdoors.','08:15','08:30','10:00','cm5d9jbil0002rtz2v79lu47p','cm5j19qcf000g68l5loxvvoam','2025-09-18 17:55:21.065'),('cm6ubn8er0003s60mcznjhnnu','Melissa Weiss - Teacher','Education',2,'You\'ll be helping me run the PE classes -- football or rugby!','Melissa Weiss','mweiss@lgusd.org','19195 Fisher Ave\r\nLos Gatos, CA 95032','Check in at the front office.','Comfortable clothes with good tennis shoes for outdoors.','13:00','13:20','14:50','cm5d9jbil0002rtz2v79lu47p','cm5j19qcf000g68l5loxvvoam','2025-09-18 17:55:21.065'),('cm6x35fe80004s60n0a6owou7','Wealth Management and Private Banking','Finance/Accounting',6,'Details to be confirmed, as some activities will require permission from active clients.\r\n\r\nIn this job shadow session, you will learn about:\r\n- Placing a trade for a stock, an option, and a portfolio. \r\n- Sitting in on a client meeting\r\n- Interviewing a client\r\n\r\nPlease do your research about investing, UBS, and come ready with questions.','Andy Ferguson','Andrew.ferguson@ubs.com ','750 University Ave\r\nSuite 250 \r\nLos Gatos, California','Lunch will be provided.','Business attire (no jeans, no sneakers).','09:45','10:00','14:00','cm5d9jbil0002rtz2v79lu47p','cm6x2gt0v0001s60nyodpx5ur','2025-09-18 17:55:21.065'),('cm6zpgrqi0000s60m5uif1m5g','Patent Attorney - Biotechnology','Law',15,'Join us to learn about patent law, a field of law that is unique because it combines both legal knowledge and technical expertise. Unlike most other areas of law, focused mainly on rules and precedents, patent law requires a deep understanding of science, engineering, or technology. In this session, two patent attorneys working in the area of biotechnology will introduce you to what patent law is, what education and skills are necessary for a career in patent law, and how rewarding a career in patent law can be, particularly when working in the medical fields.','Berrie Goldman & Simona Freeman','berrie.goldman@gmail.com','Los Gatos High School','Meet in LGHS Main Building, College & Career Center','No special requirements','11:00','11:00','12:30','cm5d9jbil0002rtz2v79lu47p','cm6rp5j9d0001s60m8tw4dcll','2025-09-18 17:55:21.065'),('cm70r55an0002s60nh98u3431','Radiologist','Healthcare',3,'Shadow a radiologist at a home office; learn a bit about the field of medicine as a career.','Kristin Schueler','kschue07@hotmail.com','126 Clover Way\r\nLos Gatos 95032','Home office; casual morning.','','09:00','09:00','11:00','cm5d9jbil0002rtz2v79lu47p','cm5j19pf0000468l5z7vixjvo','2025-09-18 17:55:21.065'),('cm7215uac0004s60nbif2itsz','Elisabeth Brown - 2nd Grade Teacher','Education',1,'Shadow teacher and class all day. Observe different lessons, work with small groups and one on one with students. See the school day through a “teacher lens”.','Elisabeth  Brown','ebrown@lgusd.org','16445 Los Gatos Blvd.\r\nLos Gatos, CA 95032','Come to front office at 7:50 am. Sign in as a visitor (you need some form of ID). Office will direct student to Room 9. Bring a water bottle, snack and a lunch.','Casual and comfy but school-appropriate for being around little kids. Covered tummy, etc.','07:50','08:00','14:15','cm5d9jbil0002rtz2v79lu47p','cm720zxue0001s60ns1hfjv92','2025-09-18 17:55:21.065'),('cm72fafic0000s60mmqnmqd83','Forensic pathologist/medical examiner','Healthcare',3,'The students would shadow me during my day as a forensic pathologist. This means participating in a meeting about cases that get examined by me, getting a lecture of what I do, and watching autopsies or external exams.','Nika Aljinovic','nika.aljinovic@mec.sccgov.org','850 Thornton Way\r\nSan Jose, CA 95128','I need to have parent’s consent for the student to participate. Please email me as soon as possible if interested and I can get you the form. Please bring an ID. I would recommend eating some food beforehand.','Closed-toe shoes, long sleeves and pants in case it gets cold - some areas of the office are colder than others.','09:30','09:30','12:30','cm5d9jbil0002rtz2v79lu47p','cm729i9j60001s60mgsicr8w2','2025-09-18 17:55:21.065'),('cm73ybhd8001ds60mlkytgfjv','Various Roles in High Tech company','Multiple Careers',15,'Students will visit Adobe\'s headquarters.\r\nThe day will start with a tour of the Adobe building, followed by lunch (provided by Adobe) and a presentation of the Adobe Express product.\r\nAfter, there will be a session with several professionals across different roles for students to get to know what they work on','Sasha Shkolnik','sshkolni@adobe.com','345 Park Ave,\r\nSan Jose, CA 95110','Go the the East Tower Lobby for check-in.\r\nExact address: 321 Park Ave, San Jose, CA 95113\r\n','Dress professionally (jeans are okay, no sweatpants)','10:00','10:15','14:30','cm5d9jbil0002rtz2v79lu47p','cm5j1a4ox005s68l5jr77cqjp','2025-09-18 17:55:21.065'),('cm74zz67s0004s60nl56nkw3s','Fire Department Services','Police/Fire/Security',6,'8:00 - 8:30      Students arrive. Welcome to Fire Prevention video - Rony Musones\r\n8:30 - 9:00      Land-Use Shadowing - Matt McKenna\r\n9:00 - 9:30      Fire Plans Examiner Shadowing - Michael Beam\r\n9:30 - 10:30    Hazmat / Fire Investigator Shadowing - Curtis Ruel\r\n10:30 - 11:30  Fire Inspection Shadowing - Rony Musones\r\n12:00 - 1:00    Los Gatos Fire Station tour - Pizza lunch\r\n1:00 - 1:30      Return to HQ\r\n\r\nWe will provide transportation for the students to an inspection and to the fire station for a tour and lunch. We will also bring the students back to Headquarters at the end of the session.','Rony Musones','Rony.musones@sccfd.org','1315 Dell Avenue\r\nCampbell, Ca, 95008','Pizza lunch will be served.','Long pants and close-toed shoes required.','08:00','08:00','13:30','cm5d9jbil0002rtz2v79lu47p','cm74ztwc10001s60nmbiqr3d3','2025-09-18 17:55:21.065'),('cm7fmd7h80000s60n3f6glm26','Photographer','Creative Arts/Design',4,'We\'ll spend the day learning about what life is like as a professional photographer. We\'ll spend the time in downtown Los Gatos, doing a couple photoshoots and then talk about post-processing, invoicing, and managing the business.','Dave Lepori','dave@leporiphoto.com','Meet at the cat statue in front of Los Gatos High School at 10:00am.','Bring money to purchase a quick lunch somewhere in LG.','Wear good walking shoes and layers, as we\'ll be inside and outside. ','10:00','10:00','14:00','cm5d9jbil0002rtz2v79lu47p','cm5j19vg5002c68l549blu1g1','2025-09-18 17:55:21.065'),('cm7md0z130008s60mown0yy6v','Holistic overview of Nvidia careers','Multiple Careers',32,'PLEASE NOTE THIS IMPORTANT CHANGE. Students will be broken up into small groups for a 2-hour visit. Please look below for your name and what time you should plan to see Nvidia.\r\n\r\nARRIVE 20 minutes early to find the right building, sign the NDA, and be ready to go.\r\n\r\n10:30-12:30 (Host: Troy)\r\nNaitik Gupta\r\nOliver Pap\r\nFinn Allan\r\nDerek Yang\r\nAnusha Adhya\r\n\r\n11:00-1:00 (Host: Mudit)\r\nJunhao Wang\r\nJanie Vidovich\r\nVir Karu\r\nSofia Czernichow\r\nGavin Seiler\r\nJohann Jacob\r\n\r\n11:30-1:30 (Host: Robert)\r\nB