an Tomas Expy\r\nBuilding D\r\nSanta Clara, CA 95051','Bring picture ID (student ID or drivers license).\r\nNDA will be completed when you sign in.\r\nLunch will be included.\r\nIf interested, bring spending money for the company store at the conclusion of your visit.','','00:00','00:00','00:00','cm5d9jbil0002rtz2v79lu47p','cm5j19t9p001k68l5pvg6a0yx','2025-09-18 17:55:21.065'),('cm7ny7pqn0000s60ny4k78f1t','Veterinarian','Veterinarian',4,'You will get to observe appointments and see treatments and diagnostics being performed on patients. ','Heather Bryant','heather@elgatovet.com','15748 Los Gatos Blvd\r\nLos Gatos, CA 95032\r\n','Please park on the street or at the nob hill next store. Please check in with the receptionist.','Please wear closed-toed shoes.','14:50','15:00','17:00','cm5d9jbil0002rtz2v79lu47p','cm5j19wra002s68l5itaksadi','2025-09-18 17:55:21.065'),('cmg8h3sio0002x40npij29ydb','Orthopedic Surgeon','Healthcare',1,'Musculoskeletal medicine and orthopedic surgery. Will see patients in the clinical setting only. ','Ian Barrett','dr.barrett@modernorthopedics.org','800 Pollard Road, Unit C30','','Business casual attire. ','9:00 AM','09:00 AM','11:45 AM','cmg8h3sha0001x40nrm3h6vdt','cm5j1a3u5005g68l5b7i5t0wt','2025-10-01 21:03:07.294'),('cmg8h3sio0003x40ntekzfxvs','Equinix Datacenter Tour & Overview of Internet','Multiple Careers',20,'Equinix datacenters are core hubs of the internet where companies like NVIDIA, SpaceX, Google, Instagram, YouTube, TikTok, Starlink, and Riot Games (League of Legends), exchange traffic. \r\n\r\nData centers: They’re something most people don’t think about every day, but they’re the foundation of the technologies we all rely on. Data centers house the infrastructure that makes everything from financial trading to online gaming to digital healthcare possible. While they might operate out-of-sight and out-of-mind for the average person, they’re the backbone of our digital world.\r\n\r\nDiscussion of jobs, not shadowing of jobs, will take place.\r\n\r\nStudents will spend two hours at a datacenter to learn how all of these companies connect and see the physical infrastructure of the Internet with a datacenter tour.  \r\n\r\nTo find out more about Equinix: https://youtu.be/wumluVRmxyA?si=4S9wZhKNRtzr-5VY','Marsie  Sweetland','msweetland@equinix.com','9 Great Oaks, San Jose','You will need to bring your student ID and allow roughly 15 minutes to sign in with security.  Please enter from Great Oaks Blvd (only).  You will pass through the security gate and the security guard will indicate the route to the datacenter.','Any attire is OK but please wear closed toe shoes for safety purposes.  The datacenter floor is cold, so wear relatively warm clothes.','09:45','10:00','12:00','cmg8h3sha0001x40nrm3h6vdt','cm5j19wgb002o68l5bm8l0yqi','2025-10-01 21:03:07.294'),('cmg8h3sio0004x40nuqquvhcw','Marketing Agency, Graphic Design, Web Development, Account Manager','Marketing/Public Relations',10,'3marketeers is a global marketing services company running programs in 93 countries. As a 39 year  company, the team develops creative, digital, video, print, event, and demand generation programs for B2B technology and healthcare companies.\n\nYou will meet with Art Directors, Graphic Designers, Web Designers, Account Managers, and other Agency team members. \nPlease plan to eat lunch with our team, where you can ask questions and learn different roles, their backgrounds and what routes they chose to get here. \n\nYou will also meet members of our eTrigue team (Marketing software).','Jeff Holmes','jeff.holmes@3marketeers.com','6399 San Ignacio Avenue, Suite 200\nSan Jose, CA\nUpstairs, second floor.','Meet at Suite 200, on the second floor. ','Casual business attire. What you would wear to a job interview.','10:00 AM','10:15 AM','1:30 PM','cmg8h3sha0001x40nrm3h6vdt','cm5j1a1lx004k68l5krj9aaxx','2025-10-01 21:03:07.294'),('cmg8h3sio0005x40nerlnqyrc','Attorney','Government/Legal',4,'Step into the shoes of trial attorney Stephanie Rickard! You will learn the ins and outs of what a criminal defense attorney does.','Stephanie Rickard','stephanie@smresq.com','1625 The Alameda, Suite 801\nSan Jose, CA 95126\n\nOur offices are situated one mile from 280 in San Jose, about a 2-mile drive from the Courthouse. Take The Alameda exit from 880 toward downtown San Jose. Proceed through two traffic lights. Look for the First Republic Bank building on the right hand side of the street. There is ample free parking behind the building.','Lunch will be provided.\n\n','Casual business attire. No jeans or sneakers. ','08:45','09:00','16:00','cmg8h3sha0001x40nrm3h6vdt','cm5j19zk7003s68l5naccs090','2025-10-01 21:03:07.294'),('cmg8h3sio0006x40nw7ku297r','Optometrist','Healthcare',3,'Private Practice Eye Care office.  Students will learn about the healthcare field, specifically primary eye care','Ilene Polhemus','imasonod@gmail.com','15575 Los Gatos Blvd., Los Gatos, CA 95032','Students will meet in the Lobby of the office','Business Casual','09:30','09:30','14:00','cmg8h3sha0001x40nrm3h6vdt','cm5j1a0ez004468l5k9lf35m7','2025-10-01 21:03:07.294'),('cmg8h3sio0007x40nqm48emkz','Engineering','Engineering/Manufacturing',15,'Experience our labs at Amazon where we build and test our devices. Learn about audio and wireless capabilities and also get to see a demonstration with our robot Astro!','Maya Osborne','mayaosbo@amazon.com','1100 Enterprise Way, Sunnyvale CA 94089','Please bring a photo ID and allow an extra 15 minutes for parking and check-in.  No food or drinks are allowed in the labs. We will provide lunch.','Please wear closed-toed shoes','09:45','10:00','15:00','cmg8h3sha0001x40nrm3h6vdt','cm5j19u97001w68l5821a0ls7','2025-10-01 21:03:07.294'),('cmg8h3sio0008x40n255qnaat','Oral and Maxillofacial Surgery','Healthcare',2,'Shadow and oral surgeon','Troy Follmar','tfollmar@follmaroms.com','14511 S. Bascom Ave, Los Gatos CA 95032','Please arrive in our waiting room at 7:30am, please make sure to eat breakfast prior to arriving.  We will cater lunch at the end of the morning.','Professional attire or scrubs','07:30','07:30','12:00','cmg8h3sha0001x40nrm3h6vdt','cm5j19zap003o68l5zfzq915f','2025-10-01 21:03:07.294'),('cmg8h3sio0009x40nqck5ekbf','Real Estate Agent','Real Estate/Construction',2,'Behind the scenes look at residential real estate sales. \nProcess discussion; from marketing, photo/videography, 3D/2D data capture, introduction to clients, needs assessment, contracts, disclosures, negotiations, legal, finance, tax, etc.. Lots more going on than \"Million Dollar Listing\" fancy homes & fabulous \"influencers\". \nWe will also \'field trip\' to visit 2 or 3 active houses for sale in Los Gatos.','Ed Dee','ed@liveyoursanctuary.com','Office Address: 16185 Los Gatos Blvd #205, Los Gatos, CA 95032, USA','Meet at Los Gatos Coffee Roasting Company on Main.\n\nCome prepared with a minimum of 3 questions pertaining to residential real estate sales.','School/Business appropriate attire. (No flip flops or shorts, etc..)','09:00','09:10','12:00','cmg8h3sha0001x40nrm3h6vdt','cm5j19yeg003c68l5ibnlkciv','2025-10-01 21:03:07.294'),('cmg8h3sio000ax40n5305cpwx','Software Engineer','Engineering/Manufacturing',2,'Study.com is an online education platform that helps learners of all ages excel academically and close skills gaps. From test prep and homework help to earning low-cost college credit and developing workplace skills, Study.com\'s online courses, short animated video lessons and study tools have made learning simple for over 30 million students, teachers and working professionals.\n \nSee what a software engineer\'s day is like at an Ed-Tech company. Get resume writing tips. Go through a practice interview. Maybe even write some code.','Jonathan Grant-Richards','jgrantrichards@study.com','100 View Street #202, Mountain View, CA 94041','Please print and have a parent sign this liability waiver. Email it to your host and/or bring it with you on job shadow day: https://drive.google.com/file/d/1P2V0lBlBs91XVHro90wVM5T4goGHQQGS/view?usp=sharing.             I can provide rides if needed.  Otherwise, just come up to the office and someone will come find me.  I will send some forms to sign beforehand.  Bring a hard copy of your resume if you have one.  Lunch will be provided.','','09:00','09:00','13:00','cmg8h3sha0001x40nrm3h6vdt','cm5j19tuv001s68l5awmt72yq','2025-10-01 21:03:07.294'),('cmg8h3sio000bx40n4n59rpj2','Various careers at Lockheed Martin','Multiple Careers',30,'This opportunity is for any student interested in the Aerospace and Defense industry.  Careers include: Engineering, Assembly, Finance, Program Management, Human Resources, etc.\r\n\r\nImportant notes:  \r\n1) You must be a US citizen to attend this session.\r\n2) Email your date of birth to admin@jobcamp.org ASAP.\r\n3) A parent/guardian will need to complete this release by Monday March 3rd. https://mrf.external.lmco.com/\r\nChoose \"2025 LM Space Los Gatos High School...\" event from the dropdown.\r\n4) Bring student ID with you on Monday, March 10th.\r\n\r\nAgenda:\r\n10-10:30 Welcome\r\n10:30-11:30 Satellite H-Bay Tour\r\n11:30-1:15 Lunch & Speed Mentoring session\r\n1:30-2:30 Solar Array Tour\r\n2:30-2:45 Wrap up','Mike Corriea','michael.r.corriea@lmco.com','Main Gate at 1111 Lockheed Martin Way, Sunnyvale, CA. \r\n\r\nParticipants will meet at the Visitors Center B/110','Please arrive at 9:15 to allow time to get through the security checkpoint.\r\n\r\nNOTE: Map apps may take you to the back gate on Enterprise Way. You need to go to the front gate instead, from Mathilda Avenue.\r\nDirections to the LM Sunnyvale Facility: \r\n1. Take US 101 North. Take the Mathilda Avenue Exit.\r\n2. Exit Mathilda Avenue North\r\n3. Merge onto North Mathilda Ave. \r\n4. Continue North for several signal lights to Lockheed Martin Way (Java Drive)\r\n5. Turn Left onto Lockheed Martin Way. You will see signs pointing to the Lockheed Martin Visitor Center (on the left, before the entrance gate guard post).\r\n6. Turn left into the Visitor Center parking lot and go inside. Identify yourself as a visitor and present your drivers license or student ID. They will already have your name on a list. You will be required to sign-in and be given a Visitor’s Badge.  \r\n7. A Lockheed Martin employee will meet you here to escort you.','Business casual with close-toed shoes.\r\n\r\nNote: electronic devices and phones must be left in the home base conference room during tours.','09:15','10:00','14:45','cmg8h3sha0001x40nrm3h6vdt','cm5j19zuj003w68l59lh2rc2c','2025-10-01 21:03:07.294'),('cmg8h3sio000cx40nfq059vzn','Investment ','Finance/Accounting',4,'Scharf Investments is a Los Gatos-based firm specializing in both investment and wealth management, helping clients build, grow, and protect their financial futures. With over $4 billion in assets under management, the firm combines research-driven investing with personalized financial planning for individuals, families, and institutions. The team includes portfolio managers, wealth advisors, analysts, and other professionals who work together to select investments, guide clients through major financial decisions, and develop long-term wealth strategies. Shadowing Scharf Investments offers an inside look at how experts collaborate to analyze markets, build investment portfolios, and create tailored financial plans. It’s an opportunity to experience the fast-paced world of finance and see strategic decision-making in action.','Kim Luong','kim.luong@scharfinvestments.com','16450 Los Gatos Blvd., Suite 207 \r\nLos Gatos, CA 95032','Ste 207 second floor. \r\nWhen students come in, they will be greeted and direct to appropriate area.  No sign in.  ','Business casual','08:00','08:05','10:00','cmg8h3sha0001x40nrm3h6vdt','cm5zuem310001s60mvq5kpfos','2025-10-01 21:03:07.294'),('cmg8h3sio000dx40nx2wliz7a','Pediatrician','Healthcare',1,'Well child checks and sick visits','Jane Chen','drc.losgatospediatrics@gmail.com','320 Dardanelli Lane\r\nSuite 16\r\nLos Gatos, CA 95032','Computer is on wheels.  Prepare to stand all day.','Professional and fun','09:30','09:30','17:30','cmg8h3sha0001x40nrm3h6vdt','cm5j1a44d005k68l5nb7klz35','2025-10-01 21:03:07.294'),('cmg8h3sio000ex40na09e5noz','PE Teacher','Education',1,'Loma Prieta Elementary School, the home of the Cougars has been serving our mountain community for more than 60 years. We are proud of our students\' academic accomplishments, as well as our commitment to educate the whole child.  Loma Prieta Elementary offers a comprehensive curriculum for grades K-5 including a specialized PE program, music, art, and science.  Our students pride themselves on being part of a caring and welcoming community. \r\n\r\nThis year you will be shadowing the PE teacher at Loma Prieta Elementary. ','Amy Ramsay','a.ramsay@lpjusd.us','23800 Summit Road','Meet in the front office ','Casual attire; closed-toed shoes','08:00','08:15','12:00','cmg8h3sha0001x40nrm3h6vdt','cm5j1a6cl006g68l5zb8mxkft','2025-10-01 21:03:07.294'),('cmg8h3sio000fx40np67voqbf','Kindergarten Teacher','Education',1,'Loma Prieta Elementary School, the home of the Cougars has been serving our mountain community for more than 60 years. We are proud of our students\' academic accomplishments, as well as our commitment to educate the whole child.  Loma Prieta Elementary offers a comprehensive curriculum for grades K-5 including a specialized PE program, music, art, and science.  Our students pride themselves on being part of a caring and welcoming community. \r\n\r\nThis year you will be shadowing one of our Kindergarten teachers at Loma Prieta Elementary. ','Amy Ramsay','a.ramsay@lpjusd.us','23800 Summit Road','Meet at the front office','casual professional attire; closed-toed shoes','08:00','08:15','12:00','cmg8h3sha0001x40nrm3h6vdt','cm5j1a6cl006g68l5zb8mxkft','2025-10-01 21:03:07.294'),('cmg8h3sio000gx40nex9gsrrd','Lori Hunt - 2nd Grade Teacher','Education',2,'You will be with me all day in the classroom both observing and participating in certain areas.','Lori Hunt','hunt_lori@cusdk8.org','12300 De Sanka Avenue\r\nSaratoga, CA 95070',' Meet me in the school\'s front entrance at 8:00am.\r\nBring your own lunch.  ','Jeans are OK, just no holes. ','08:00','08:00','14:30','cmg8h3sha0001x40nrm3h6vdt','cm62w3pvs0003s60mskhtk909','2025-10-01 21:03:07.294'),('cmg8h3sio000hx40n2j4tfudl','Melissa Hickman - 1st/2nd Combo Teacher','Education',2,'You will be helping me and observing in the classroom, learning what it\'s like to be an elementary school teacher. It\'s going to be fun!','Melissa Hickman','hickman_melissa@cusdk8.org','12300 De Sanka Avenue\r\nSaratoga, CA 95070','Bring your own lunch. \r\n\r\nIf you want to leave early at lunch that\'s ok too ( at 12:10). \r\n\r\nCome to the office in the morning and I can meet you there.','Make sure you wear comfortable clothes because we move around a lot and will have PE that day too. ','08:00','08:00','14:30','cmg8h3sha0001x40nrm3h6vdt','cm62w3pvs0003s60mskhtk909','2025-10-01 21:03:07.294'),('cmg8h3sio000ix40nk2wg6nxu','Rachel Cherry - 2nd Grade Teacher','Education',2,'You will be observing and helping me in the classroom. You will learn what it\'s like to be an elementary school teacher.  It\'ll be fun!','Rachel Cherry','cherry_rachel@cusdk8.org','12300 De Sanka Avenue\r\nSaratoga, CA 95070','Bring your own lunch.\r\n\r\nCome to the school\'s front office and I will meet you there.','Wear close toed shoes and dress in layers. ','08:00','08:00','14:30','cmg8h3sha0001x40nrm3h6vdt','cm62w3pvs0003s60mskhtk909','2025-10-01 21:03:07.294'),('cmg8h3sio000jx40n924prk5a','Megan Mahoney - 5th Grade Teacher','Education',2,'Be ready to work with small groups of students in my 5th grade classroom!','Megan Mahoney','mmahoney@lgusd.org','17770 Daves Avenue\r\nMonte Sereno, CA 95030','Come to the school\'s front office and I will meet you there.','Please wear school appropriate clothing.','08:00','08:00','10:00','cmg8h3sha0001x40nrm3h6vdt','cm62xb5a7000as60mrvxurrx3','2025-10-01 21:03:07.294'),('cmg8h3sio000kx40nl88dcde3','Jolynn Dariano - Kindergarten Teacher','Education',2,'You will be assisting at a rotation, prepping projects, and helping out at recess. ','Jolynn Dariano','jdariano@lgusd.org','17770 Daves Avenue\r\nMonte Sereno, CA 95030','Feel free to bring a snack. ','Please wear school appropriate clothing.','08:00','08:15','10:30','cmg8h3sha0001x40nrm3h6vdt','cm62xb5a7000as60mrvxurrx3','2025-10-01 21:03:07.294'),('cmg8h3sio000lx40n6hyd4nm2','Healthcare Professionals Medical Panel','Healthcare',15,'Joining the medical panel will give you an opportunity to hear from multiple healthcare professionals during the session.\r\n\r\nAs of Jan 18th, the medical panel consists of:\r\n\r\n* Ben Cortez: Pediatric Intensivist at Kaiser (Panel Moderator)\r\n* Karolina Thompson:  OBGYN at Kaiser\r\n* Carolyn Ford-Hemann:  Healthcare administrator overseeing 2 surgery centers, ambulatory care, and Kaiser professional for 20 years\r\n* Balaji Venkat:  Emergency room physician\r\n* Janet Hong-Auyoung:  PA at Kaiser / Clinical manager\r\n','Ben Cortez','benedicto.cortez@gmail.com','Los Gatos High School\r\nRoom 5 (main building)','Come ready with questions!','','08:50','09:00','10:30','cmg8h3sha0001x40nrm3h6vdt','cm5j19z03003k68l521pgr9pq','2025-10-01 21:03:07.294'),('cmg8h3sio000mx40n99foh83z','Mental Health Professionals Panel','Healthcare',6,'Join us to learn about becoming a mental health professional. There will be at least two professional psychologists/psychotherapists to talk about different paths to this field and what our work looks like.','Holly Osment, LMFT, LPCC, CST','hollyosment@gmail.com','15814 Winchester Blvd, Suite 101\r\nLos Gatos, CA 95030','Building is very close to the intersection of Winchester & Daves Ave, and next door to Pottery Planet.\r\nSuite 101 is in the front of the building. Park and look for signs guiding you to the correct spot.','Casual; anything is fine','08:50','09:00','10:30','cmg8h3sha0001x40nrm3h6vdt','cm6411y3x0001s60m4mabwxgo','2025-10-01 21:03:07.294'),('cmg8h3sio000nx40nm4i7a5n7','Startup Founder, Entrepreneur, and Venture Capitalist (investor)','Entrepreneurship',15,'Join for aninteractive session where I’ll share my personal story of founding a tech venture, transitioning into venture capital, and investing in bold new markets—ranging from pet tech to AI, alternative energy, and beyond. Along the way, you’ll hear real startup successes (and failures) gathered from my experiences building and investing in companies on five continents.\r\n\r\nCome ready to brainstorm and ask questions. We’ll open the floor to your ideas, dive into the ups and downs of the startup world, and explore how you can turn your own vision into reality. I’ll also offer access to my network and help connect you with potential mentors in the tech and business community. Whether you’re dreaming of building the next big thing or just curious about the world of entrepreneurship, this session will give you an inside look—and maybe spark your own journey, too.','Collin Hartigan','collinhartigan@gmail.com','Los Gatos High School College & Career Center (main building)','Bring all of your questions and your best startup ideas','','10:00','10:05','11:00','cmg8h3sha0001x40nrm3h6vdt','cm65cymva0001s60m3ebg5kvw','2025-10-01 21:03:07.294'),('cmg8h3sip000ox40ngqngs0bv','Electric Bike Shop Founder & Owner','Small Business Owner',9,'Andrew Davidge, founder of Vintage Electric, is an LGHS graduate. He is opening his shop for a tour and to share his business model and how LGHS helped him create this business. ','Andrew Davidge','andrew@vintageelectricbikes.com','1725 De La Cruz Blvd\r\nSuite 4 \r\nSanta Clara, CA 95050','','Wear close-toed shoes. \r\nCasual attire is fine.','12:55','13:00','15:00','cmg8h3sha0001x40nrm3h6vdt','cm65egxxj0006s60mjyv4b66t','2025-10-01 21:03:07.294'),('cmg8h3sip000px40nsuqpia1u','Michelle Peattie - Kindergarten Teacher','Education',2,