30','Meet at the restaurant at 9am with any note taking materials you might want. ','Close toed shoes','09:00','09:00','11:00','cmg8h3sha0001x40nrm3h6vdt','cm5j1a2q5005068l5szszw7tf','2025-10-01 21:03:07.294'),('cmg8h3sip000tx40n308ldla5','Medical Assistant','Healthcare',1,'Interested in what an Medical Assistant does? Shadow our MA rooming patients, preparing and consenting for procedures, room set-up and turn-over, and much more.','Brianna Morris','losgatospodiatrygroup@gmail.com','14651 S. Bascom Ave\r\nSuite 215\r\nLos Gatos 95032','','Please dress in casual business attire (the office wears scrubs but we would not require students to buy scrubs for the Job Shadow Day), Lunch will be provided from 1-2pm.','08:15','08:30','16:30','cmg8h3sha0001x40nrm3h6vdt','cm68ilmhz0001s60maeonmpes','2025-10-01 21:03:07.294'),('cmg8h3sip000ux40npg2zxdmt','Front Office Administrator','Healthcare',1,'Interested in Front Office? Shadow our Front Office staff scheduling appointments, patient Check-in and Check-out, Patient intake, Practice Management data entry, and much more.','Brianna Morris','losgatospodiatrygroup@gmail.com','14651 S. Bascom Ave\r\nSuite 215\r\nLos Gatos 95032','','Please dress in casual business attire (the office wears scrubs but we would not require students to buy scrubs for the Job Shadow Day), Lunch will be provided from 1-2pm.','08:15','08:30','16:30','cmg8h3sha0001x40nrm3h6vdt','cm68ilmhz0001s60maeonmpes','2025-10-01 21:03:07.294'),('cmg8h3sip000vx40nvrpac8po','Podiatrist','Healthcare',1,'Interested in what a Provider does? Shadow our providers as they evaluate and treat patients for various foot/ankle issues.','Brianna Morris','losgatospodiatrygroup@gmail.com','14651 S. Bascom Ave\r\nSuite 215\r\nLos Gatos 95032','','Please dress in casual business attire (the office wears scrubs but we would not require students to buy scrubs for the Job Shadow Day), Lunch will be provided from 1-2pm.','08:15','08:30','16:30','cmg8h3sha0001x40nrm3h6vdt','cm68ilmhz0001s60maeonmpes','2025-10-01 21:03:07.294'),('cmg8h3sip000wx40ntuua1x23','Data Analytics','Engineering/Manufacturing',3,'Spring Education Group is a multi-brand network providing private school education from infant care through high school. The company has 204 schools across the U.S. & internationally, and a globally accessible online private school education from infant care through high school.\r\n\r\nThe student will have overview of Spring Education organization. And then he/she will have an opportunity of learning of the role of analytics department. There will be presentations and samples of data projects including tools (Tableau and Salesforce) are used in the department. The shadow will be in Pruneyard, Campbell. The VP of Analytics will host the students.','Fatosh Hacigumus','fatosh@gmail.com','\r\n1999 S Bascom Avenue, Suite 400 • Campbell, CA',' The student can be dropped off at 1999 S. Bascom Avenue, Campbell. The host will be waiting in the lobby at 8:45 AM. The shadowing session will run until 11:30 AM, followed by lunch.','Business casual','08:45','09:00','12:00','cmg8h3sha0001x40nrm3h6vdt','cm5j19ypp003g68l53gog4bac','2025-10-01 21:03:07.294'),('cmg8h3sip000xx40nsbjm4zr2','Software Developer','Engineering/Manufacturing',30,'Learn about Software Development at a large tech company.  \r\nFormat: A brief presentation followed by a coding demo and Q&A.\r\nPresenter has 20+ years developing software for Automotive, Aerospace and 5+ years at Meta.','Cameron Tulee','cktulee@gmail.com','LGHS College & Career Center (main building)','LGHS College & Career Center (main building)','No special requirements','14:15','14:30','16:30','cmg8h3sha0001x40nrm3h6vdt','cm6ely7av0001s60m973x5635','2025-10-01 21:03:07.294'),('cmg8h3sip000yx40nc91qka8d','Introduction to robotic aided surgery','Multiple Careers',25,'Attendees will receive a presentation to provide Company overview, complete manufacturing line tour, daVinci system demonstration and also interact for career conversation with Intuitive team members.','Ryan Bertsch','ryan.bertsch@intusurg.com','Intuitive Surgical, Building 115, 3420 Central Expressway, Santa Clara, CA 95051','Arrival Time: 10:00:00 AM\r\nEnd Time: 1:30:00 PM\r\n\r\nInstructions:\r\n10:00 – 10:10AM: Welcome \r\n10:10 – 10:45AM: Company overview, products and operations \r\n10:45 – 11:30AM: Manufacturing tour \r\n11:30 – 12:30PM: da Vinci system demonstration \r\n12:30 – 1:30PM: Interactive discussion and working lunch with cross discipline professionals (Finance, Operations, and Engineering) \r\n1:30PM: Closing\r\n','Business casual; closed toe shoes for manufacturing area tour and system demo','09:45','10:00','13:30','cmg8h3sha0001x40nrm3h6vdt','cm5j19q1n000c68l5rcqgdxff','2025-10-01 21:03:07.294'),('cmg8h3sip000zx40ns4mkmxmg','General/Family Dentist','Healthcare',2,'digital imaging (3D scanning) and milling crowns, observing dentists, hygienists, dental assistants on a typical day in the life at a dental office, behind the scenes. ','Christina Fantino','oakmeadowdental@gmail.com','Oak Meadow Dental Center\r\n210 Oak Meadow Dr\r\nLos Gatos, CA 95032','Bring your questions, enthusiasm and arrive on-time. We will be meeting 15 minutes prior to our morning huddle and you will be able to see what our day is like from the dentists perspective. ','Please wear scrubs if possible as well as closed toed (tennis type shoes)','08:30','08:30','12:00','cmg8h3sha0001x40nrm3h6vdt','cm5j19vvl002g68l5bb5s9801','2025-10-01 21:03:07.294'),('cmg8h3sip0010x40npc2tggkk','Commercial Real Estate Broker ','Real Estate/Construction',1,'As a commercial real estate broker, I act as an intermediary between property owners and businesses looking to lease commercial spaces. My role involves analyzing market trends, valuing properties, and negotiating deals to ensure the best outcomes for your clients. You\'ll spend time networking, conducting property tours, and developing in-depth knowledge of local real estate markets. Strong communication and problem-solving skills are essential, as you\'ll often be working to align the interests of multiple parties in complex transactions.','Alyssa Chaulklin','alyssa.chaulklin@jll.com','356 Santana Row, Suite 1000 San Jose CA, 95128','Our office is located at Santana Row. There is a parking garage where we can provide validated parking. Our suite is located between Arc\'Teryx and Madewell on the second floor. ','Our office follows business casual attire. Jeans are okay, but they should not have any rips, show midriff or sagging. Shirts should not have any large graphics, logos or too revealing. Standard attire for the men in our office include polo shirts, dark jeans and a comfortable shoe. Standard attire for the women in our office include modest blouse, dark jeans and comfortable shoes. ','09:00','09:30','14:30','cmg8h3sha0001x40nrm3h6vdt','cm6i5wnzk0001s60mt9i7fqvk','2025-10-01 21:03:07.294'),('cmg8h3sip0011x40nc2ygqzfn','Pediatric Dentist at Los Gatos Pediatric Dentistry','Healthcare',2,'We are Los Gatos Pediatric Dentistry and Dr Rabitz Pediatric Dentistry. We are a local pediatric dental practice providing comprehensive, compassionate care for children in the community. Our experienced team of professionals are committed to helping children build and maintain a healthy smile for life. \r\n\r\nBy using a playful approach and gentle chairside manner, our team can get even the most hesitant children to relax and accept dental care. Our goal is to protect children\'s teeth and gums and inspire good dental care habits for lifelong oral health. ','Chanel McCreedy','chanel@lgkidsdentistry.com','15827 Los Gatos Blvd, Suite B\r\nLos Gatos, CA 95032','Please come through the front door of the office to be greeted by our front office team. You\'ll meet with our pediatric dentist and observe a day of pediatric dentistry.','Please arrive in professional, business casual attire with closed toed shoes. ','12:00','12:00','15:30','cmg8h3sha0001x40nrm3h6vdt','cm5j19tjt001o68l5aqlyr1b5','2025-10-01 21:03:07.294'),('cmg8h3sip0012x40nss58k9i2','Adtech Sales Professional','Sales',25,'Calling all students who are interested in studying Communications, Marketing, Business, Creative and/or Data Analytics. You will learn all the fun (and grit!) that is part of Adtech at Pinterest. This includes components of consultative sales, creative strategy and measurement in order to help advertising partners plan, execute and succeed with digital advertising campaigns. \r\n\r\nWe will discuss what it means to have strategic vision, partnership building skills, product expertise and most importantly, great collaboration skills when working in the industry and at Pinterest! ','Sally Zeman','szeman@pinterest.com','395 Page Mill Rd, Palo Alto, CA\r\n2nd floor ','Free parking is available behind the building and main entrance is from the parking lot. This meeting requires pre-registration by the student in sharing their name and email address when signing up and then host will send them a short non-disclosure agreement from Pinterest, Inc, to sign in advance. Please bring ID for checking-in and your own water bottle.','','13:45','14:00','15:30','cmg8h3sha0001x40nrm3h6vdt','cm5jxflyk0001s60ms1aoxxxw','2025-10-01 21:03:07.294'),('cmg8h3sip0013x40n59fo8638','Dentist','Healthcare',1,'Step into the shoes of Dr. Nicole Pagonis and see the ins and outs of what it\'s like to be a dentist. Dr. P and her terrific team are ready to welcome 1 lucky student!','Nicole Pagonis','contact@doctorpdentistry.com','14830 Los Gatos Blvd\r\nSuite 104\r\nLos Gatos, CA 95032','Please print and complete this form. Bring it with you to job shadow day.\r\nhttps://drive.google.com/file/d/1qs5le4ufWoWAao9DtgHQco1H1BqwxfW7/view?usp=sharing','Business casual attire appropriate for a doctor\'s office employee.','09:00','09:00','11:00','cmg8h3sha0001x40nrm3h6vdt','cm5j1a25b004s68l5c31q1uj0','2025-10-01 21:03:07.294'),('cmg8h3sip0014x40nqmnbhkje','Family Physician','Healthcare',1,'Students will shadow me as I take care of patients in my office with the patient\'s approval.','Tiffany Davies, MD','tdavies@losgatosdoctors.com','360 Dardanelli Ln\r\nLos Gatos, CA 95032','You will have a 2 hour break at lunch where you may either leave to get food or can stay here and eat something brought from home.  \r\n\r\nIf you wish to shorten the day, you can leave before 5pm.','Dress in business casual attire.','08:30','08:30','17:00','cmg8h3sha0001x40nrm3h6vdt','cm6k7ugw80001s60ni5fxs43v','2025-10-01 21:03:07.294'),('cmg8h3sip0015x40ne0rkrcma','Product Marketing','Marketing/Public Relations',10,'How to get into Product Marketing\r\nWhat is relevant to Cybersecurity customers.\r\nHow to get into Cybersecurity\r\nWhat does Product Marketing do?','Andrew Horwitz','ahorwitz@netskope.com','2445 Augustine Dr 3rd floor\r\nSanta Clara, CA 95054','Park in parking deck and get ticket.  We have a machine to validate.\r\nTake elevator to the third floor','Business Casual','09:45','10:00','12:00','cmg8h3sha0001x40nrm3h6vdt','cm6qpa1ud0001s60m99711034','2025-10-01 21:03:07.294'),('cmg8h3sip0016x40n3scyzz4u','Probation Officer','Police/Fire/Security',10,'Students will learn about the role of Probation in the community, the requirements for becoming a Probation Officer and the probation career pathway. ','Victoria Contreras-Wolfe','victoria.contreras-wolfe@pro.sccgov.org','840 Guadalupe Parkway\r\nSan Jose, CA  95110','Please meet outside the building at the Juvenile Center sign located in front of 840 Guadalupe Parkway.  ','Business casual.  Clothing should be free from offensive images, words or logos. ','09:00','09:30','16:00','cmg8h3sha0001x40nrm3h6vdt','cm6qx4vok0001s60nvpmw8qps','2025-10-01 21:03:07.294'),('cmg8h3sip0017x40nwjwd33ma','Marketing, Product Mgmt, Engineering','Multiple Careers',2,'Students will get a tour of the NVIDIA headquarters in Santa Clara. They will get introduced to people in various teams from marketing, to product management, to engineering working on AI (artificial intelligence) products. I will give them advice on my career journey and what they should think about as they go through high school, apply to colleges, think about internships, and ultimately a major and career. Students will experience a day in the life of one of the leading AI and graphics companies in the world. Lunch will be provided.','Charlie Huang','charlieandjenny@gmail.com','NVIDIA HQ (Endeavor Building)\r\n2788 San Tomas Expressway\r\nSanta Clara, CA 95051\r\n','Meet at the lobby of the NVIDIA Endeavor building at 9:30am. Bring ID to sign in for a visitor badge.\r\nLunch will be provided.\r\nI will provide some souvenier, but students can bring extra money if they are interested in buying any additional NVIDIA logo\'d items.','Business casual. Khakis/chinos and a collared shirt preferred. Jeans okay, but no holes. Close toed shoes preferred. No slippers, no beachwear.\r\n','09:30','09:30','13:30','cmg8h3sha0001x40nrm3h6vdt','cm5j1a3k2005c68l56qicnjeu','2025-10-01 21:03:07.294'),('cmg8h3sip0018x40nctkszr3n','Engineering','Engineering/Manufacturing',15,'Archer is a leader in electric vertical takeoff and landing (eVTOL) aircraft.  Afternoon will include an overview of Archer and air taxi industry, tour of battery manufacturing, aircraft build and simulator facilities. Everyone will get a chance to fly the aircraft simulator.','Tosha Perkins','tosha.perkins@archer.com','190 W. Tasman, San Jose, CA 95134','Students will sign an NDA once they are assigned to this position. ','Closed-toed shoes','14:30','15:00','17:00','cmg8h3sha0001x40nrm3h6vdt','cm69xi1lw0001s60mr69jrg5o','2025-10-01 21:03:07.294'),('cmg8h3sip0019x40ndermg6lm','Jennie Fink - Kindergarten Teacher','Education',1,'helping me teach, working with children :)','jennie fink','jfink@lgusd.org','16445 Los Gatos Blvd.','Our day starts at 8:10 in room 4. Please check in at the front office.','comfortable :)','08:00','08:10','13:30','cmg8h3sha0001x40nrm3h6vdt','cm5j19x1s002w68l5j8gppk9i','2025-10-01 21:03:07.294'),('cmg8h3sip001ax40nkz97q95h','Lisa Antunes - 6th Grade English Teacher','Education',2,'Students will be helping me in the classroom with a 6th grade English class.','Lisa Antunes','lantunes@lgusd.org','19195 Fisher Ave\r\nLos Gatos, CA 95032','Check in at the main office.\r\nRoom R6.','','10:30','10:15','12:00','cmg8h3sha0001x40nrm3h6vdt','cm5j19qcf000g68l5loxvvoam','2025-10-01 21:03:07.294'),('cmg8h3sip001bx40nsqtxv2er','Non-Profit Manager / Executive Director','Non-Profit',4,'The exact agenda is TBD, but it will be a mix of time spent outdoors in the community or at a school site, in meetings and in the office reviewing contracts and budgeting. ','Wendy Riggs','lgsr2s@gmail.com','17010 Roberts Rd, Los Gatos CA 95032','We will begin the day at a school site in Los Gatos or Monte Sereno, exact meeting spot TBD','Dress business casual (jeans are OK) wear comfortable walking shoes. We will be outdoors a times, so dress for the weather.','07:45','07:45','15:00','cmg8h3sha0001x40nrm3h6vdt','cm6tx43n90001s60ngf5ck77x','2025-10-01 21:03:07.294'),('cmg8h3sip001cx40ni0j2k26j','Corey Miller - Musical Theater & Choir Teacher','Education',3,'I\'ll be working with my Musical Theatre Class, Treble Choir, and Encore advanced choir.','Corey Miller','cmiller@lgusd.org','19195 Fisher Ave\r\nLos Gatos, CA 95032','Bring own lunch. \r\nCheck in at the front office.','','08:15','08:30','13:15','cmg8h3sha0001x40nrm3h6vdt','cm5j19qcf000g68l5loxvvoam','2025-10-01 21:03:07.294'),('cmg8h3sip001dx40n1dy2e0xf','Melissa Weiss - Teacher','Education',2,'You\'ll be helping me run the PE classes -- football or rugby!','Melissa Weiss','mweiss@lgusd.org','19195 Fisher Ave\r\nLos Gatos, CA 95032','Check in at the front office.','Comfortable clothes with good tennis shoes for outdoors.','08:15','08:30','10:00','cmg8h3sha0001x40nrm3h6vdt','cm5j19qcf000g68l5loxvvoam','2025-10-01 21:03:07.294'),('cmg8h3sip001ex40nxsehvqtu','Melissa Weiss - Teacher','Education',2,'You\'ll be helping me run the PE classes -- football or rugby!','Melissa Weiss','mweiss@lgusd.org','19195 Fisher Ave\r\nLos Gatos, CA 95032','Check in at the front office.','Comfortable clothes with good tennis shoes for outdoors.','13:00','13:20','14:50','cmg8h3sha0001x40nrm3h6vdt','cm5j19qcf000g68l5loxvvoam','2025-10-01 21:03:07.294'),('cmg8h3sip001fx40n14uqne6k','Wealth Management and Private Banking','Finance/Accounting',6,'Details to be confirmed, as some activities will require permission from active clients.\r\n\r\nIn this job shadow session, you will learn about:\r\n- Placing a trade for a stock, an option, and a portfolio. \r\n- Sitting in on a client meeting\r\n- Interviewing a client\r\n\r\nPlease do your research about investing, UBS, and come ready with questions.','Andy Ferguson','Andrew.ferguson@ubs.com ','750 University Ave\r\nSuite 250 \r\nLos Gatos, California','Lunch will be provided.','Business attire (no jeans, no sneakers).','09:45','10:00','14:00','cmg8h3sha0001x40nrm3h6vdt','cm6x2gt0v0001s60nyodpx5ur','2025-10-01 21:03:07.294'),('cmg8h3sip001gx40nr8tcx6vo','Patent Attorney - Biotechnology','Law',15,'Join us to learn about patent law, a field of law that is unique because it combines both legal knowledge and technical expertise. Unlike most other areas of law, focused mainly on rules and precedents, patent law requires a deep understanding of science, engineering, or technology. In this session, two patent attorneys working in the area of biotechnology will introduce you to what patent law is, what education and skills are necessary for a career in patent law, and how rewarding a career in patent law can be, particularly when working in the medical fields.','Berrie Goldman & Simona Freeman','berrie.goldman@gmail.com','Los Gatos High School','Meet in LGHS Main Building, College & Career Center','No special requirements','11:00','11:00','12:30','cmg8h3sha0001x40nrm3h6vdt','cm6rp5j9d0001s60m8tw4dcll','2025-10-01 21:03:07.294'),('cmg8h3siq001hx40ntt6b6jjm','Radiologist','Healthcare',3,'Shadow a radiologist at a home office; learn a bit about the field of medicine as a career.','Kristin Schueler','kschue07@hotmail.com','126 Clover Way\r\nLos Gatos 95032','Home office; casual morning.','','09:00','09:00','11:00','cmg8h3sha0001x40nrm3h6vdt','cm5j19pf0000468l5z7vixjvo','2025-10-01 21:03:07.294'),('cmg8h3siq001ix40nsvjkvqse','Elisabeth Brown - 2nd Grade Teacher','Education',1,'Shadow teacher and class all day. Observe different lessons, work with small groups and one on one with students. See the school day through a “teacher lens”.','Elisabeth  Brown','ebrown@lgusd.org','16445 Los Gatos Blvd.\r\nLos Gatos, CA 95032','Come to front office at 7:50 am. Sign in as a visitor (you need some form of ID). Office will direct student to Room 9. Bring a water bottle, snack and a lunch.','Casual and comfy but school-appropriate for being around little kids. Covered tummy, etc.','07:50','08:00','14:15','cmg8h3sha0001x40nrm3h6vdt','cm720zxue0001s60ns1hfjv92','2025-10-01 21:03:07.294'),('cmg8h3siq001jx40nk7uelcvu','Forensic pathologist/medical examiner','Healthcare',3,'The students would shadow me during my day as a forensic pathologist. This means participating in a meeting about cases that get examined by me, getting a lecture of what I do, and watching autopsies or external exams.','Nika Aljinovic','nika.aljinovic@mec.sccgov.org','850 Thornton Way\r\nSan Jose, CA 95128','I need to have parent’s consent for the student to participate. Please email me as soon as possible if interested and I can get you the form. Please bring an ID. I would recommend eating some food beforehand.','Closed-toe shoes, long sleeves and pants in case it gets cold - some areas of the office are colder than others.','09:30','09:30','12:30','cmg8h3sha0001x40nrm3h6vdt','cm729i9j60001s60mgsicr8w2','2025-10-01 21:03:07.294'),('cmg8h3siq001kx40nxhu645mb','Various Roles in High Tech company','Multiple Careers',15,'Students will visit Adobe\'s headquarters.\r\nThe day will start with a tour of the Adobe building, followed by lunch (provided by Adobe) and a presentation of the Adobe Express product.\r\nAfter, there will be a session with several professionals across different roles for students to get to know what they work on','Sasha Shkolnik','sshkolni@adobe.com','345 Park Ave,\r\nSan Jose, CA 95110','Go the the East Tower Lobby for check-in.\r\nExact address: 321 Park Ave, San Jose, CA 95113\r\n','Dress professionally (jeans are okay, no sweatpants)','10:00','10:15','14:30','cmg8h3sha0001x40nrm3h6vdt','cm5j1a4ox005s68l5jr77cqjp','2025-10-01 21:03:07.294'),('cmg8h3siq001lx40n3n34da0h','Fire Department Services','Police/Fire/Security',6,'8:00 - 8:30      Students arrive. Welcome to Fire Prevention video - Rony Musones\r\n8:30 - 9:00      Land-Use Shadowing - Matt McKenna\r\n9:00 - 9:30      Fire Plans Examiner Shadowing - Michael Beam\r\n9:30 - 10:30    Hazmat / Fire Investigator Shadowing - Curtis Ruel\r\n10:30 - 11:30  Fire Inspection Shadowing - Rony Musones\r\n12:00 - 1:00    Los Gatos Fire Station tour - Pizza lunch\r\n1:00 - 1:30      Return to HQ\r\n\r\nWe will provide transportation for the students to an inspection and to the fire station for a tour and lunch. We will also bring the students back to Headquarters at the end of the session.','Rony Musones','Rony.musones@sccfd.org','1315 Dell Avenue\r\nCampbell, Ca, 95008','Pizza lunch will be served.','Long pants and close-toed shoes required.','08:00','08:00','13:30','cmg8h3sha0001x40nrm3h6vdt','cm74ztwc10001s60nmbiqr3d3','2025-10-01 21:03:07.294'),('cmg8h3siq001mx40nc5o77vc9','Photographer','Creative Arts/Design',4,'We\'ll spend the day learning about what life is like as a professional photographer. We\'ll spend the time in downtown Los Gatos, doing a couple photoshoots and then talk about post-processing, invoicing, and managing the business.','Dave Lepori','dave@leporiphoto.com','Meet at the cat statue in front of Los Gatos High School at 10:00am.','Bring money to purchase a quick lunch somewhere in LG.','Wear good walking shoes and layers, as we\'ll be inside and outside. ','10:00','10:00','14:00','cmg8h3sha0001x40nrm3h6vdt','cm5j19vg5002c68l549blu1g1','2025-10-01 21:03:07.294'),('cmg8h3siq001nx40nqoiadn3f','Holistic overview of Nvidia careers','Multiple Careers',32,'PLEASE NOTE THIS IMPORTANT CHANGE. Students will be broken up into small groups for a 2-hour visit. Please look below for your name and what time you should plan to see Nvidia.\r\n\r\nARRIVE 20 minutes early to find the right building, sign the NDA, and be ready to go.\r\n\r\n10:30-12:30 (Host: Troy)\r\nNaitik Gupta\r\nOliver Pap\r\nFinn Allan\r\nDerek Yang\r\nAnusha Adhya\r\n\r\n11:00-1:00 (Host: Mudit)\r\nJunhao Wang\r\nJanie Vidovich\r\nVir Karu\r\nSofia Czernichow\r\nGavin Seiler\r\nJohann Jacob\r\n\r\n11:30-1:30 (Host: Robert)\r\nBenjamin Swei\r\nShaurya Piplani\r\nClaira Wong\r\nEstelle Paduano\r\nAiden Gao\r\nArnav Singhal\r\n\r\n12:00-2:00 (Host: Kevin)\r\nAedan Barirani\r\nSzu-An Chen\r\nAdrian Hsu\r\nAnvita Anand\r\nAdvika Anand\r\n\r\n12:30-2:30 (Host: Troy)\r\nYufan Ou\r\nCole Hastings\r\nLeonardo Madrigal\r\nSoren Krumwiede\r\nPravin Balasingam\r\n\r\n1:00-3:00 (Host: Mudit)\r\nAndrew Zheng\r\nCaroline Nauss\r\nLily Campion\r\nSamantha Ematrudo\r\nShaodong Xu','Troy Hastings','thastings@nvidia.com','2701 San Tomas Expy\r\nBuilding D\r\nSanta Clara, CA 95051','Bring picture ID (student ID or drivers license).\r\nNDA will be completed when you sign in.\r\nLunch will be included.\r\nIf interested, bring spending money for the company store at the conclusion of your visit.','','00:00','00:00','00:00','cmg8h3sha0001x40nrm3h6vdt','cm5j19t9p001k68l5pvg6a0yx','2025-10-01 21:03:07.294'),('cmg8h3siq001ox40nlzi0m067','Holistic overview of Nvidia careers','Multiple Careers',32,'PLEASE NOTE THIS IMPORTANT CHANGE.  Students will be broken up into small groups for a 2-hour visit.  Please look below for your name and what time you should plan to see Nvidia.  \r\n\r\nARRIVE 20 minutes early to find the right building, sign the NDA, and be ready to go.\r\n\r\n10:30-12:30 (Host: Troy)\r\nNaitik Gupta\r\nOliver Pap\r\nFinn Allan\r\nDerek Yang\r\nAnusha Adhya\r\n\r\n11:00-1:00 (Host: Mudit)\r\nJunhao Wang\r\nJanie Vidovich\r\nVir Karu\r\nSofia Czernichow\r\nGavin Seiler\r\nJohann Jacob\r\n\r\n11:30-1:30 (Host: Robert)\r\nBenjamin Swei\r\nShaurya Piplani\r\nClaira Wong\r\nEstelle Paduano\r\nAiden Gao\r\nArnav Singhal\r\n\r\n12:00-2:00 (Host: Kevin)\r\nAedan Barirani\r\nSzu-An Chen\r\nAdrian Hsu\r\nAnvita Anand\r\nAdvika Anand\r\n\r\n12:30-2:30 (Host: Troy)\r\nYufan Ou\r\nCole Hastings\r\nLeonardo Madrigal\r\nSoren Krumwiede\r\nPravin Balasingam\r\n\r\n1:00-3:00 (Host: Mudit)\r\nAndrew Zheng\r\nCaroline Nauss\r\nLily Campion\r\nSamantha Ematrudo\r\nShaodong Xu','Troy Hastings','thastings@nvidia.com','2701 San Tomas Expy\r\nBuilding D\r\nSanta Clara, CA 95051','Bring picture ID (student ID or drivers license).\r\nNDA will be completed when you sign in.\r\nLunch will be included.\r\nIf interested, bring spending money for the company store at the conclusion of your visit.','','00:00','00:00','00:00','cmg8h3sha0001x40nrm3h6vdt','cm5j19t9p001k68l5pvg6a0yx','2025-10-01 21:03:07.294'),('cmg8h3siq001px40n3ylm8qsr','Veterinarian','Veterinarian',4,'You will get to observe appointments and see treatments and diagnostics being performed on patients. ','Heather Bryant','heather@elgatovet.com','15748 Los Gatos Blvd\r\nLos Gatos, CA 95032\r\n','Please park on the street or at the nob hill next store. Please check in with the receptionist.','Please wear closed-toed shoes.','14:50','15:00','17:00','cmg8h3sha0001x40nrm3h6vdt','cm5j19wra002s68l5itaksadi','2025-10-01 21:03:07.294');
